--
-- Name: get_possible_profit_last_month(); Type: FUNCTION; Schema: finance; Owner: postgres
--

CREATE FUNCTION finance.get_possible_profit_last_month() RETURNS money
    LANGUAGE sql
    AS $$
with
  appointment_counts as
    (
      select
        patient_id
      , count(id) as appointments_count
      from
        meeting.appointments
      where
        datetime between date_trunc('month', current_date - interval '1 month') and date_trunc('month', current_date)
      group by
        patient_id
    ),
  collapsed_data as
    (
      select
        a.patient_id
      , a.appointments_count
      , tools.get_age(u.birth_date) as age
      from
        appointment_counts as a
          join usr.users as u on a.patient_id = u.id
    )
select coalesce(sum(tools.charge(age, appointments_count)), 0::money) as possible_profit
from
  collapsed_data;
$$;


ALTER FUNCTION finance.get_possible_profit_last_month() OWNER TO postgres;

--
-- Name: doctors_appointments_report(date, date); Type: FUNCTION; Schema: meeting; Owner: postgres
--

CREATE FUNCTION meeting.doctors_appointments_report(begin_date date, end_date date) RETURNS TABLE(doctor_id integer, day_of_week text, time_slot time without time zone, total_num_appointments_per_time_slot bigint, average_visits_per_time_slot numeric)
    LANGUAGE plpgsql IMMUTABLE
    AS $$
declare
  num_same_time_slots int := (end_date - begin_date) / 7;
begin
  return query
    with dated_appointments as
    (
      select a.doctor_id
           , to_char(a.datetime, 'day') as day_of_week
           , date_trunc('hour', a.datetime)::time as time_slot
           , a.patient_id
      from meeting.appointments as a
    ),
    calculated_appointments as
    (
      select distinct
             a.doctor_id
           , a.day_of_week
           , a.time_slot
           , count(a.patient_id) over(partition by a.doctor_id
                                                 , a.day_of_week
                                                 , a.time_slot) as total_num_appointments_per_time_slot
      from dated_appointments as a
    )
    select a.doctor_id
         , a.day_of_week
         , a.time_slot
         , a.total_num_appointments_per_time_slot
         , (a.total_num_appointments_per_time_slot::numeric / num_same_time_slots) as average_visits_per_time_slot
    from calculated_appointments as a;
end;
$$;


ALTER FUNCTION meeting.doctors_appointments_report(begin_date date, end_date date) OWNER TO postgres;

--
-- Name: patients_last_appointments(integer); Type: FUNCTION; Schema: meeting; Owner: postgres
--

CREATE FUNCTION meeting.patients_last_appointments(pat_id integer) RETURNS TABLE(appointment_id integer, doctor_id integer, patient_id integer, appointment_datetime timestamp without time zone, appointment_location character varying)
    LANGUAGE plpgsql IMMUTABLE
    AS $$
begin
  return query
    with ranked_appointments as (
      select a.id
           , a.doctor_id
           , a.patient_id
           , a.datetime
           , a.location
           , rank() over (order by a.datetime::date desc) as rank
      from meeting.appointments as a
      where a.patient_id = pat_id
    )
    select ra.id, ra.doctor_id, ra.patient_id, ra.datetime, ra.location
    from ranked_appointments as ra
    where ra.rank = 1;
end;
$$;


ALTER FUNCTION meeting.patients_last_appointments(pat_id integer) OWNER TO postgres;

