CREATE FUNCTION meeting.patients_last_appointments_for_query_1(pat_id integer, first_name_pat text, last_name_pat text) RETURNS TABLE(appointment_id integer, doctor_id integer, patient_id integer, appointment_datetime timestamp without time zone, appointment_location character varying, first_name character varying, last_name character varying, is_dead boolean, email character varying, clinic_number character varying)
    LANGUAGE plpgsql IMMUTABLE
    AS $$
begin
  return query
    select a.appointment_id, a.doctor_id, a.patient_id, a.appointment_datetime, a.appointment_location,
           u.first_name, u.last_name, u.is_dead, u.email, d.clinic_number
    from meeting.patients_last_appointments(pat_id) as a
    join usr.users as u
      on u.id = a.doctor_id
    join usr.doctors as d
      on d.id = a.doctor_id
    where tools.xor(
       u.first_name similar to first_name_pat,
       u.last_name  similar to last_name_pat
    );
end;
$$;


