--
-- Name: can_patient_stay_at_in_patient_clinic(integer, integer, timestamp without time zone, timestamp without time zone); Type: FUNCTION; Schema: tools; Owner: postgres
--

CREATE FUNCTION tools.can_patient_stay_at_in_patient_clinic(new_patient_id integer, new_place_id integer, new_check_in_datetime timestamp without time zone, new_check_out_datetime timestamp without time zone) RETURNS boolean
    LANGUAGE plpgsql IMMUTABLE
    AS $$ begin
  return not exists(
    -- the given place is not occupied at the given time
    -- or
    -- the given person does not occupy some place at the given time
    select *
    from ipc.in_patient_clinic_stay as s
    where (s.place_id = new_place_id or s.occupied_by = new_patient_id)
      and (s.check_in_datetime, s.check_out_datetime) overlaps
          (new_check_in_datetime, coalesce(new_check_out_datetime, timestamp 'infinity'))
  );
end; $$;


