CREATE FUNCTION tools.number_of_weeks_between(begin_date date, end_date date) RETURNS integer
    LANGUAGE plpgsql IMMUTABLE
    AS $$ begin
  return (end_date - begin_date) / 7;
end; $$;


ALTER FUNCTION tools.number_of_weeks_between(begin_date date, end_date date) OWNER TO postgres;

--
-- Name: number_of_weeks_from_epoch(); Type: FUNCTION; Schema: tools; Owner: postgres
--

CREATE FUNCTION tools.number_of_weeks_from_epoch() RETURNS integer
    LANGUAGE plpgsql IMMUTABLE
    AS $$ begin
  return ('now'::date - 'epoch'::date) / 7;
end; $$;


ALTER FUNCTION tools.number_of_weeks_from_epoch() OWNER TO postgres;

