-- Name: number_of_weeks_from_epoch(date); Type: FUNCTION; Schema: tools; Owner: postgres
--

CREATE FUNCTION tools.number_of_weeks_from_epoch(d date) RETURNS integer
    LANGUAGE plpgsql IMMUTABLE
    AS $$ begin
