--
-- Name: time_slots_for_range(timestamp without time zone, timestamp without time zone, interval); Type: FUNCTION; Schema: tools; Owner: postgres
--

CREATE FUNCTION tools.time_slots_for_range(begin_time timestamp without time zone, end_time timestamp without time zone, time_slot_size interval) RETURNS TABLE(time_slot_begin timestamp without time zone, time_slot_end timestamp without time zone)
    LANGUAGE plpgsql IMMUTABLE
    AS $$
begin
  return query
    with recursive time_slots_recursive as
    (
      select begin_time as time_slot_begin
           , begin_time + time_slot_size as time_slot_end

      union

      select r.time_slot_end as time_slot_begin
           , r.time_slot_end + time_slot_size as time_slot_end
      from time_slots_recursive as r
      where (r.time_slot_end + time_slot_size) <= end_time
    )
    select t.time_slot_begin
         , t.time_slot_end
    from time_slots_recursive as t;
end;
$$;


ALTER FUNCTION tools.time_slots_for_range(begin_time timestamp without time zone, end_time timestamp without time zone, time_slot_size interval) OWNER TO postgres;

--
-- Name: xor(boolean, boolean); Type: FUNCTION; Schema: tools; Owner: postgres
--

CREATE FUNCTION tools.xor(x boolean, y boolean) RETURNS boolean
    LANGUAGE plpgsql IMMUTABLE
    AS $$ begin
  return (not x and y) or (x and not y);
end; $$;


ALTER FUNCTION tools.xor(x boolean, y boolean) OWNER TO postgres;

--
-- Name: frequent_patients(date, date); Type: FUNCTION; Schema: usr; Owner: postgres
--

CREATE FUNCTION usr.frequent_patients(start_date date, end_date date) RETURNS TABLE(patient_id integer, total_appointment_count numeric, first_name character varying, last_name character varying, email character varying, birth_date date, is_dead boolean, insurance_company character varying, insurance_number character varying)
    LANGUAGE sql
    AS $$
with
  week_data as
    (select
       patient_id
--   get how many appointments there been during each week from the start date
     , tools.number_of_weeks_between(start_date, datetime::date) as week_no
     , count(*)                                                  as appointment_count
     from
       meeting.appointments
     where
       datetime between start_date and end_date
     group by
       patient_id, tools.number_of_weeks_between(start_date,
                                                 datetime::date)
     having
       count(*) >= 2
--    consider only those who had at least 2 appointments per week

    )
, result_patients as
    (
      select
        patient_id
      , sum(appointment_count) as total_appointment_count
      from
        week_data
      group by
        patient_id
      having
        -- 1 month is from 0 to 4 weeks between 2 dates inclusively
        -- 1 + since function may returns values from 0 to (start+end) div 7
        count(*) = 1 + tools.number_of_weeks_between(start_date, end_date)
    )
select
  r.patient_id
, r.total_appointment_count
, u.first_name
, u.last_name
, u.email
, u.birth_date
, u.is_dead
, u.insurance_company
, u.insurance_number
from
  result_patients as r
    join usr.users as u on r.patient_id = u.id
$$;


ALTER FUNCTION usr.frequent_patients(start_date date, end_date date) OWNER TO postgres;

--
-- Name: get_experiences_doctors(integer, integer, integer); Type: FUNCTION; Schema: usr; Owner: postgres
--

CREATE FUNCTION usr.get_experiences_doctors(patients_per_year integer, patients_total integer, years_period integer) RETURNS TABLE(doctor_id integer, total_appointments numeric, first_name character varying, last_name character varying, email character varying, birth_date date, is_dead boolean)
    LANGUAGE sql
    AS $$
with
  yearly_data as
    (
      select
        doctor_id
      , count(*)                    as appointments_count
      , date_part('year', datetime) as year
      from
        meeting.appointments
      where -- work only with data for last 10 years
            date_part('year', datetime) between date_part('year', now() - make_interval(years := years_period))
              and date_part('year', now())
      group by
        doctor_id, date_part('year', datetime)
      having -- Ensures that doctor had an appointment with at least 5 patients during the period
             count(distinct patient_id) >= patients_per_year
    )
, passed_constraints as
    (select
       doctor_id
     , sum(appointments_count) as total_appointments
     from
       yearly_data as y
         join usr.users as u on y.doctor_id = u.id
     group by
       doctor_id
     having
         sum(appointments_count) >= patients_total -- Doctor have in total at least 100 appointments
     and count(year) = years_period -- Doctor had an appointment with at least 5 patients each year during 10 years
    )
select
  p.doctor_id
, p.total_appointments
, u.first_name
, u.last_name
, u.email
, u.birth_date
, u.is_dead
from
  passed_constraints as p
    join usr.users as u on p.doctor_id = u.id;
$$;


ALTER FUNCTION usr.get_experiences_doctors(patients_per_year integer, patients_total integer, years_period integer) OWNER TO postgres;

