--
-- Name: users_roles; Type: VIEW; Schema: usr; Owner: postgres
--

CREATE VIEW usr.users_roles AS
 SELECT u.id AS user_id,
    (p.id IS NOT NULL) AS is_patient,
    (h.id IS NOT NULL) AS is_hr,
    (d.id IS NOT NULL) AS is_doctor,
    (n.id IS NOT NULL) AS is_nurse,
    (im.id IS NOT NULL) AS is_inventory_manager,
    (ph.id IS NOT NULL) AS is_pharmacist,
    (lt.id IS NOT NULL) AS is_lab_technician,
    (r.id IS NOT NULL) AS is_receptionist,
    (pm.id IS NOT NULL) AS is_paramedic,
    (a.id IS NOT NULL) AS is_admin
   FROM ((((((((((usr.users u
     LEFT JOIN usr.patients p ON ((p.id = u.id)))
     LEFT JOIN usr.hrs h ON ((h.id = u.id)))
     LEFT JOIN usr.doctors d ON ((d.id = u.id)))
     LEFT JOIN usr.nurses n ON ((n.id = u.id)))
     LEFT JOIN usr.inventory_managers im ON ((im.id = u.id)))
     LEFT JOIN usr.pharmacists ph ON ((ph.id = u.id)))
     LEFT JOIN usr.lab_technicians lt ON ((lt.id = u.id)))
     LEFT JOIN usr.receptionists r ON ((r.id = u.id)))
     LEFT JOIN usr.paramedics pm ON ((pm.id = u.id)))
     LEFT JOIN usr.admins a ON ((a.id = u.id)));


ALTER TABLE usr.users_roles OWNER TO postgres;

